  const map = L.map("map", { preferCanvas: true });

  const base = L.tileLayer(
    "https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png",
    { maxZoom: 19, attribution: "&copy; OpenStreetMap contributors" }
  ).addTo(map);

  // No shading (fillOpacity 0), slightly thicker boundaries (weight 3)
  function styleBigLocal() {
    return { color: "#d73027", weight: 3, fillOpacity: 0 };
  }
  function stylePiP() {
    return { color: "#4575b4", weight: 3, fillOpacity: 0 };
  }

  const geojsonLayers = {};

  // Popup + hover
  function onEachFeatureFactory(label) {
    return function (feature, layer) {
      const p = feature.properties || {};
      const name =
        p.custom_area_name ||
        p.name ||
        p.area_name ||
        p.town_name ||
        p.Town ||              // <-- your Town Pride file uses "Town"
        "Unnamed";

      layer.bindPopup(`<b>${label}</b><br>${name}`);

      layer.on({
        mouseover: (e) => {
          e.target.setStyle({ weight: 5, fillOpacity: 0 });
          e.target.bringToFront();
        },
        mouseout: (e) => {
          geojsonLayers[label].resetStyle(e.target);
        }
      });
    };
  }

  geojsonLayers["Big Local areas"] = L.geoJSON(bigLocalGeojson, {
    style: styleBigLocal,
    onEachFeature: onEachFeatureFactory("Big Local areas")
  }).addTo(map);

  geojsonLayers["PiP MSOA areas"] = L.geoJSON(pipMsoaGeojson, {
    style: stylePiP,
    onEachFeature: onEachFeatureFactory("PiP MSOA areas")
  }).addTo(map);

  // Town Pride points as smaller markers
  geojsonLayers["Town Pride points"] = L.geoJSON(townPrideGeojson, {
    pointToLayer: (feature, latlng) => L.circleMarker(latlng, {
      radius: 3,        // smaller icon
      weight: 1.5,
      color: "#1a9850",
      fillOpacity: 0.9
    }),
    onEachFeature: onEachFeatureFactory("Town Pride points")
  }).addTo(map);

  L.control.layers(
    { "OpenStreetMap": base },
    geojsonLayers,
    { collapsed: false }
  ).addTo(map);

  const group = L.featureGroup([
    geojsonLayers["Big Local areas"],
    geojsonLayers["PiP MSOA areas"],
    geojsonLayers["Town Pride points"]
  ]).addTo(map);
  map.fitBounds(group.getBounds(), { padding: [20, 20] });

  const legend = L.control({ position: "bottomleft" });
  legend.onAdd = function () {
    const div = L.DomUtil.create("div", "legend");
    div.innerHTML = `
      <div><b>Area types</b></div>
      <div class="legend-item"><span class="swatch" style="background:#d73027"></span>Big Local</div>
      <div class="legend-item"><span class="swatch" style="background:#4575b4"></span>PiP MSOA</div>
      <div class="legend-item"><span class="swatch" style="background:#1a9850"></span>Town Pride points</div>
    `;
    return div;
  };
  legend.addTo(map);

</script>
